import React from "react";
import Pokemon from "./Pokemon";
import Data from "./data"
class Pokedex extends React.Component {
    render() {
        const pokeList = Data.map((d) => <Pokemon name={d.name} type={d.type} weigth={`${d.averageWeight.value}${d.averageWeight.measurementUnit}`} img={d.image}/>)
        return pokeList
    }
}

export default Pokedex
